Dzień dobrym, mam do sprzedania samochód osobowy marki Skoda Octavia wyprodukowany w 2007 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1896 cm3, legitymujący się mocą 105 KM, który pokonał do tej pory 257000 km. Samochód pod względem mechanicznym do poprawek, silnik odpala bez problemów ciepły czy zimny, lecz przy dodaniu gazu słychać metaliczny stukot, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Skoda prezentuje się jak na zdjęciach, uszkodzony tył pojazdu, oraz widoczna rdza na drzwiach tylnych od strony kierowcy. Wnętrze pojazdu prezentuje się jak na zdjęciach brak radia.



Octavia jest wyposażenia w:

- Automatyczną dwustrefową klimatyzacje;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie i tylne;

- Elektrycznie sterowane i podgrzewane lusterka;

- 4 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 30.07.2025 roku.

Przegląd techniczny BRAK
